package com.dotta.medidata.models.query;

/*This is a Studio Managed File. DO NOT EDIT THIS FILE. Your changes may be reverted by Studio.*/


import java.io.Serializable;
import java.util.Objects;

import javax.validation.constraints.NotNull;

import com.fasterxml.jackson.annotation.JsonProperty;

public class ForgotPasswordRequest implements Serializable {


    @JsonProperty("pwd")
    @NotNull
    private String pwd;

    @JsonProperty("name")
    @NotNull
    private String name;

    public String getPwd() {
        return this.pwd;
    }

    public void setPwd(String pwd) {
        this.pwd = pwd;
    }

    public String getName() {
        return this.name;
    }

    public void setName(String name) {
        this.name = name;
    }

    @Override
    public boolean equals(Object o) {
        if (this == o) return true;
        if (!(o instanceof ForgotPasswordRequest)) return false;
        final ForgotPasswordRequest forgotPasswordRequest = (ForgotPasswordRequest) o;
        return Objects.equals(getPwd(), forgotPasswordRequest.getPwd()) &&
                Objects.equals(getName(), forgotPasswordRequest.getName());
    }

    @Override
    public int hashCode() {
        return Objects.hash(getPwd(),
                getName());
    }
}